webpackJsonp([0x6976f67fbfd1],{2459:function(t,a){t.exports={data:{markdownRemark:{html:"<p><strong>ðŸŒ¡ 18 â„ƒ</strong></p>\n<p>Today, there was an event called parent recreation in the school gym. It is like a mini sports festival to participate with parents and children.</p>\n<p>The first event is a card matching game. Although I ran quickly, I was spared the time while I was looking for someone who had an answer card that matched the problem and I was fourth.</p>\n<p>Next, I played a paper scraping ball game. It is a competition that takes paper one by one, rounds it and puts it in a basket like a ball. I brought this to the tie.</p>\n<p>Lastly it ended with parent and child dancing the Soran clause. it was fun.</p>",frontmatter:{cover:null,date:"1990-10-20T21:30:00+09:00",strDate:"1990/10/20",title:"diary"}}},pathContext:{path:"/en/blog/1990/10/20-diary/",langKey:"en"}}}});
